import React, { useEffect } from 'react';
import '../src/Contact.css';
import Typed from 'typed.js';

function Contact() {
    const el = React.useRef(null);

    useEffect(() => {
        const typed = new Typed(el.current, {
            strings: ["greetingLanguage"],
            typeSpeed: 50,
            backSpeed: 50,
            loop: true,
            backDelay: 1000,
            cursorChar: '|',
            autoInsertCss: false,
        });
        return () => {
            typed.destroy();
        }
    }, []);


    return (
        <>
            <div className='contactSection d-flex flex-column align-items-center justify-content-center'>
                <p className="fs-1" style={{ opacity: "80%" }}>Get in touch</p>

                <span className='fs-5' ref={el}></span>

            </div>
        </>
    );
}

export default Contact;
